import { useRouter } from 'next/router';
import Layout from '../../components/MyLayout';
import CarList from '../../components/Lists/CarList';
import ApiBasicUrl from '../../configuration/model/apiSettings';
import fetch from 'isomorphic-unfetch'

const Post = (props) => {
  const router = useRouter();

  return (
    <Layout>
      <CarList cars={props.cars}/>
    </Layout>
  );
}

Post.getInitialProps = async () => {
  const res = await fetch(ApiBasicUrl().concat("/car.json"));
  const data = await res.json();
  
  return {
    cars: data.map(entry => entry.car)
  };
};

export default Post
